// import React from 'react'
import ExpensesItem from './ExpensesItem'
function Expenses(props) {
	const arr = props.item
	return (
		<div>
			{arr.map((el) => {
				return (
					<ExpensesItem
						key={el.id}
						title={el.title}
						amout={el.amout}
						date={el.date}
					/>
				)
			})}
		</div>
	)

