    return(
        
        <div>
            
        <ExpensesItem title = {props.item[0].title} amout = {props.item[0].amout} date = {props.item[0].date}/>
        <ExpensesItem title = {props.item[1].title} amout = {props.item[1].amout} date = {props.item[1].date}/>
        </div>
       
        
    ) */
}
export default Expenses
